import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
import { useDispatch, useSelector } from 'react-redux';
import { getTemperaments, getDogs } from '../../redux/actions/actions';

export default function Form() {
    const [breed, setBreed] = useState('');
    const [age, setAge] = useState('');
    const [temperaments, setTemperaments] = useState([]);
    const [selectedTemperaments, setSelectedTemperaments] = useState([]);
    const [heightMin, setHeightMin] = useState('');
    const [heightMax, setHeightMax] = useState('');
    const [weightMin, setWeightMin] = useState('');
    const [weightMax, setWeightMax] = useState('');
    
    const dispatch = useDispatch();

    useEffect(() => {
      dispatch(getTemperaments());
    }, [dispatch]);
    
    const createBreed = async (breedData) => {
      await axios.post('http://localhost:3001/dogs', breedData);
      dispatch(getDogs());
      // Aquí puedes agregar más acciones que necesites invocar
      // por ejemplo: dispatch(getByName(breedData.breed));
      // o dispatch(FilterByWeight({ min: breedData.weightMin, max: breedData.weightMax }));
  };

    return (
      <>
          <label>
           Breed:
          <input value={breed} onChange={e => setBreed(e.target.value)}/>
          </label>
        <hr />
          <label htmlFor={age}>Age</label>
          <input id="age" name="age" type="number" value={age} onChange={e => setAge(e.target.value)} />
        <hr />
        <label htmlFor="heightMin">Height (min)</label> 
        <input id="heightMin" name="heightMin" type="number" value={heightMin} onChange={e => setHeightMin(e.target.value)} />
        <hr />
        <label htmlFor="heightMax">Height (max)</label> 
        <input id="heightMax" name="heightMax" type="number" value={heightMax} onChange={e => setHeightMax(e.target.value)} />
        <hr />
        <label htmlFor="weightMin">Weight (min)</label> 
        <input id="weightMin" name="weightMin" type="number" value={weightMin} onChange={e => setWeightMin(e.target.value)} />
        <hr />
        <label htmlFor="weightMax">Weight (max)</label> 
        <input id="weightMax" name="weightMax" type="number" value={weightMax} onChange={e => setWeightMax(e.target.value)} />
        <hr />
        
        <div>
  {temperaments.map((temperament) => (
    <div key={temperament}>
      <label>
        <input
          type="checkbox"
          value={temperament}
          checked={selectedTemperaments.includes(temperament)}
          onChange={(event) => {
            if (event.target.checked) {
              setSelectedTemperaments([...selectedTemperaments, temperament]);
            } else {
              setSelectedTemperaments(selectedTemperaments.filter((t) => t !== temperament));
            }
          }}
        />
        {temperament}
      </label>
    </div>
  ))}
</div>
        <br />
        <button onClick={() => createBreed({ breed, age, heightMin, heightMax, weightMin, weightMax, selectedTemperaments })}>Create Breed</button>   
    </>


    );
  }

  {/* Nombre.
Altura ().
Peso (diferenciar entre peso mínimo y máximo de la raza).
Años de vida.
Posibilidad de seleccionar/agregar varios temperamentos en simultáneo.
Botón para crear la nueva raza.
validado sólo con JavaScript. 
Por ejemplo: que el nombre de la raza no pueda contener números,
 o que el peso/altura mínimo no pueda ser mayor al máximo.*/}

 {/* Para validar los datos ingresados en el formulario, 
debes agregar lógica adicional en el código que capture 
y procese los valores ingresados. 
Puedes hacer esto en la función del botón "Create Breed",
 que se ejecuta cuando se hace clic en el botón. 
Por ejemplo, puedes agregar condiciones para verificar si 
los valores ingresados son válidos y, en caso contrario,
 mostrar un mensaje de error.
También puedes agregar lógica para validar el campo de nombre
 y asegurarte de que no contenga números.*/}
